import React from "react";

function Item({user, idx, getResult}){
    console.log("item rendering");
    return(
        <div key={idx}>
            <div>idx : {idx}</div>
            <div>이름 : {user.name}</div>
            <div>나이 : {user.age}</div>
            <div>점수 : {user.score}</div>
            <div>등급 : {getResult(user.score).grade}</div>
        </div>
    );
}

export default Item;
